  -- Signals
  SIGNAL lutaddr_unsigned                 : unsigned(13 DOWNTO 0);  -- ufix14
  SIGNAL lutaddrInReg                     : unsigned(13 DOWNTO 0) := to_unsigned(16#0000#, 14);  -- ufix14
  SIGNAL lut1addr                         : unsigned(9 DOWNTO 0);  -- ufix10
  SIGNAL Lookup_Table1_k                  : unsigned(9 DOWNTO 0);  -- ufix10
  SIGNAL lut1out                          : signed(13 DOWNTO 0);  -- sfix14_En13
  SIGNAL lut2addrp1                       : unsigned(4 DOWNTO 0);  -- ufix5
  SIGNAL lut2addrp2                       : unsigned(3 DOWNTO 0);  -- ufix4
  SIGNAL lut2addr                         : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL Lookup_Table2_k                  : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL lut2out                          : unsigned(3 DOWNTO 0);  -- ufix4_En4
  SIGNAL lut1out_reg                      : signed(13 DOWNTO 0) := to_signed(16#0000#, 14);  -- sfix14_En13
  SIGNAL lut2out_reg                      : unsigned(3 DOWNTO 0) := to_unsigned(16#0#, 4);  -- ufix4_En4
  SIGNAL lut2out_extend                   : signed(13 DOWNTO 0);  -- sfix14_En13
  SIGNAL lut2out_sf                       : signed(13 DOWNTO 0);  -- sfix14_En13
  SIGNAL adder_add_cast                   : signed(14 DOWNTO 0);  -- sfix15_En13
  SIGNAL adder_add_cast_1                 : signed(14 DOWNTO 0);  -- sfix15_En13
  SIGNAL adder_add_temp                   : signed(14 DOWNTO 0);  -- sfix15_En13
