  -- Lookup table 1 address
  lut1addr <= lutaddrInReg(13 DOWNTO 4);

  -- Quarter sine wave table-Part1
  
  Lookup_Table1_k <= to_unsigned(16#000#, 10) WHEN lut1addr = to_unsigned(16#000#, 10) ELSE
