    END IF;
  END PROCESS LUT2outRegister_process;


  lut2out_extend <= signed(resize(lut2out_reg & '0' & '0' & '0' & '0' & '0' & '0' & '0' & '0' & '0', 14));

  -- Shift look up table 2 outputs
  lut2out_sf <= lut2out_extend srl 9;

  -- Compute look up table output
  adder_add_cast <= resize(lut1out_reg, 15);
  adder_add_cast_1 <= resize(lut2out_sf, 15);
  adder_add_temp <= adder_add_cast + adder_add_cast_1;
  
  addlutouts <= "01111111111111" WHEN (adder_add_temp(14) = '0') AND (adder_add_temp(13) /= '0') ELSE
